import './App.css';
import Sidebar from './components/sidebar/sidebar';
import Home from './pages/home/home';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Home />
      <Sidebar />
      <Routes></Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
